    function Addition() public pure returns (uint){
        uint Num3 = 5;
        uint Num4 = 10;
        return (Num4 +Num3);
    }

    // using pure to solve maths when variable is passed in the parameter. input is made in the contract
    function Sub (uint Num5, uint Num6) public pure returns (uint){
        return (Num5 -Num6);
    }
}

